var transComplete, ourRadius;
transComplete = effect('Zoom - bubble')('Transition Completion');
ourRadius = $bm_div(Math.sqrt($bm_sum($bm_mul(thisLayer.width, thisLayer.width), $bm_mul(thisLayer.height, thisLayer.height))), 2);
$bm_rt = easeIn(transComplete, 55, 100, ourRadius, 0);

var $bm_rt;
var transComplete;
transComplete = effect('Zoom - bubble')('Transition Completion');
$bm_rt = easeOut(transComplete, 0, 67, 0, 100);

p.x:
var $bm_rt;
var n, n, t, t, v, amp, freq, decay;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time) {
        n--;
    }
}
if (n == 0) {
    $bm_rt = t = 0;
} else {
    $bm_rt = t = $bm_sub(time, key(n).time);
}
if (n > 0 && t < 1) {
    v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
    amp = 0.05;
    freq = 4;
    decay = 8;
    $bm_rt = $bm_sum(value, $bm_div($bm_mul($bm_mul(v, amp), Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul(decay, t))));
} else {
    $bm_rt = value;
}

